import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ListaDeTarefas from './pages/ListaDeTarefas';
import QuemEuSou from './pages/QuemEuSou';
// Importe outras páginas...

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/lista-de-tarefas" component={ListaDeTarefas} />
        <Route path="/quem-eu-sou" component={QuemEuSou} />
        {/* Adicione outras rotas aqui */}
      </Switch>
    </Router>
  );
}

export default App;
